import React from 'react';

function TODOList(){
    const [tasks, setTasks] = React.useState(["Nothing to do!"]);
    return(
        <div>
            <h1>ToDo List</h1>
            {tasks.map((task) =>{
                return <div key={task}>{task}</div>;
            })}
            <div class="container">
                <form role="form">
                    <div class="row" style={{marginTop:"20%"}}>
                        <div class="container">
                            <div class="row">
                                <div class="col-sm-6">
                                    <input type="text" class="form-control input-normal" placeholder="insert task" />
                                </div>
                                <div class="col-sm-6">
                                <button type="submit" class="btn btn-default">Submit</button>
                                </div>
                            </div>
                        </div>

                    </div>
                </form>
            </div>
        </div>  
    )
}

export default TODOList;
